    private function bundle($data, $elements = []){
        foreach($data as $element){
            if($element["resource"]["resourceType"] != "Bundle")
                $elements[] = $element["resource"];
            else
                $elements = $this->bundle($element["resource"]["entry"], $elements);
        }
        return $elements;
    }

